import { useState } from "react";
import axios from "axios";

function App() {

  const [cep, setCep] = useState()

const options = {
    url: 'https://viacep.com.br/ws/${cep}/json/',
    method:'GET',
    headers:{
        'Accept': 'application/json',
        'Content-type': 'application/json;charset=UTF-8'

    },

    params:{
        a:10,
        b:20
    }
}

axios(options)
    .then(response=>{
        console.log(response.data)
    })

  return (
    <div>
      <div className="Card">
        <div className="Title">
        MeuLocal-ViaCep
        </div>
        <div className="Form">
          <input type="string" name='cep' onChange={(e)=> setCep(e.target.value)} id='cep' minLength='8' maxLength='8'/><br/>
          <input type="submit" value='Descobrir meu Local' className="Botao"/>
        </div>
      </div>
    </div>
  );
}

export default App;
